text = ""

#Returns the reverse complement for the given gene snippet
def ReverseComp(text):
    inverse = ""
    
    #Creates the standard complement of provided gene snippet
    for i in range(len(text)):
        if text[i] == "A":
            inverse = inverse + "T"
        elif text[i] == "T":
            inverse = inverse + "A"
        elif text[i] == "C":
            inverse = inverse + "G"
        elif text[i] == "G":
            inverse = inverse + "C"
    
    #Reverses the resulting complement     
    inverse = inverse[::-1]
    return inverse

print(ReverseComp(text))
